import React from 'react'
import NavRoute from './NavRoute.js'

const Skills =  () => {
    return (
        <>
            <div style={{ marginTop: '150px'}} className='container'>
                <h1 className='nameText'>cheese!</h1>
                <hr/>
            </div>
            <NavRoute />
        </>
    )
}

export default Skills;
